import React, { createContext } from 'react';
import ReactDOM from 'react-dom';
import App from './App';

const Context = createContext(null)

ReactDOM.render(
  <Context.Provider value={{
    user
  }}>
    <App />
  </Context.Provider>,
  document.getElementById('root')
);
